import {useNavigation} from 'react-router-dom';

function IsUserAuthenticated(user, redirectUrl = '/login') {
    const useNavigation = useNavigation();

    if(!user){
        navigate(redirectUrl);
    }
}

export default IsUserAuthenticated;
